  input: 'TEXT,F3XA,,"First, (Schedule B: Allocation of Expenses) the NJSLPAC/LPL
    (an SSF) is registered as both a federal and non-federal state PAC. The federal
    PAC acts as the collecting entity, which then periodically transfers monies to
    both our affiliated organization (LPL) and to our non-federal PAC. Accordingly,
    all federal expenses are paid by the connected organization and all non-federal
    expenses are paid by the non-federal state PAC. Second, (Line 11(a)(ii) Unitemized
    Receipts) all unitemized receipts are comprised of contributions from individuals
    under $200 in the aggregate. Third, in response to your 02/11/04 letter, this
    PAC will file a F99 with respect to the excessive contribution made to the DSCC
    on 0710/03. The PAC has requested a refund from the DSCC which will then be proprerly
    recorded in our next Quarterly Report."'
